import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 28.2-800 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/28.2-800.md","filePath":"vacode/28.2-800.md"}'),s={name:"vacode/28.2-800.md"},r=o('<h1 id="§-28-2-800-definitions" tabindex="-1">§ 28.2-800 Definitions. <a class="header-anchor" href="#§-28-2-800-definitions" aria-label="Permalink to &quot;§ 28.2-800 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Crustacea&quot; means all edible species of crab, lobster and shrimp, whether raw or processed.</p><p>&quot;Depuration&quot; means the process that uses a controlled aquatic environment to reduce the level of bacteria or viruses in live shellfish.</p><p>&quot;Establishment&quot; means any vehicle, vessel, property or premises where crustacea, finfish or shellfish are transported, held, stored, processed, packed, repacked, or pasteurized in preparation for marketing.</p><p>&quot;Finfish&quot; means any cold-blooded, strictly aquatic, water-breathing craniate vertebrate with fins, including cyclostomes, elasmobranchs and higher-gilled aquatic vertebrates with cartilaginous or bony skeletons or any parts thereof.</p><p>&quot;Relay&quot; means to move shellfish for the purpose of natural purification from water which is not approved to water which is approved or conditionally approved by the State Health Commissioner.</p><p>&quot;Shellfish&quot; means all species within the phylum Mollusca including but not limited to oysters, clams, mussels, scallops, conchs and whelks, whether raw or processed.</p><p>1979, c. 714, § 28.1-175.1; 1992, c. 836.</p>',9),i=[r];function n(c,l,p,h,d,u){return t(),a("div",null,i)}const _=e(s,[["render",n]]);export{m as __pageData,_ as default};
